CREATE  TABLE "public".category ( 
	category_id          serial  NOT NULL  ,
	category             varchar  NOT NULL  ,
	CONSTRAINT pk_category PRIMARY KEY ( category_id )
 );

CREATE  TABLE "public".country ( 
	country_id           serial  NOT NULL  ,
	country              varchar  NOT NULL  ,
	CONSTRAINT pk_country PRIMARY KEY ( country_id )
 );

CREATE  TABLE "public".region ( 
	region_id            serial  NOT NULL  ,
	region               varchar  NOT NULL  ,
	country_id           integer  NOT NULL  ,
	CONSTRAINT pk_region PRIMARY KEY ( region_id ),
	CONSTRAINT fk_region_country FOREIGN KEY ( country_id ) REFERENCES "public".country( country_id )   
 );

CREATE  TABLE "public".segment ( 
	segment_id           serial  NOT NULL  ,
	segment              varchar  NOT NULL  ,
	CONSTRAINT pk_segment PRIMARY KEY ( segment_id )
 );

CREATE  TABLE "public".sex ( 
	sex_id               serial  NOT NULL  ,
	sex                  char(1)  NOT NULL  ,
	CONSTRAINT pk_sex PRIMARY KEY ( sex_id )
 );

CREATE  TABLE "public".shipping ( 
	ship_id              serial  NOT NULL  ,
	ship_mode            varchar  NOT NULL  ,
	CONSTRAINT pk_shipping PRIMARY KEY ( ship_id )
 );

CREATE  TABLE "public"."state" ( 
	state_id             serial  NOT NULL  ,
	"state"              varchar  NOT NULL  ,
	region_id            integer  NOT NULL  ,
	CONSTRAINT pk_tbl PRIMARY KEY ( state_id ),
	CONSTRAINT fk_state_region FOREIGN KEY ( region_id ) REFERENCES "public".region( region_id )   
 );

CREATE  TABLE "public".sub_category ( 
	sub_category_id      serial  NOT NULL  ,
	sub_category         varchar  NOT NULL  ,
	category_id          integer  NOT NULL  ,
	CONSTRAINT pk_sub_category PRIMARY KEY ( sub_category_id ),
	CONSTRAINT fk_sub_category_category FOREIGN KEY ( category_id ) REFERENCES "public".category( category_id )   
 );

CREATE  TABLE "public".city ( 
	city_id              serial  NOT NULL  ,
	city                 varchar  NOT NULL  ,
	postal_code          varchar  NOT NULL  ,
	state_id             integer  NOT NULL  ,
	CONSTRAINT pk_city PRIMARY KEY ( city_id ),
	CONSTRAINT fk_city_state FOREIGN KEY ( state_id ) REFERENCES "public"."state"( state_id )   
 );

CREATE  TABLE "public".customer ( 
	customer_id          varchar  NOT NULL  ,
	name                 varchar(100)  NOT NULL  ,
	surname              varchar(100)  NOT NULL  ,
	day_of_birth         date  NOT NULL  ,
	sex_id               integer  NOT NULL  ,
	CONSTRAINT pk_customer PRIMARY KEY ( customer_id ),
	CONSTRAINT fk_customer_sex FOREIGN KEY ( sex_id ) REFERENCES "public".sex( sex_id )   
 );

CREATE  TABLE "public".manager ( 
	manager_id           serial  NOT NULL  ,
	name                 varchar(100)  NOT NULL  ,
	surname              varchar(100)  NOT NULL  ,
	day_of_birth         date  NOT NULL  ,
	sex_id               integer  NOT NULL  ,
	region_id            integer    ,
	CONSTRAINT pk_manager PRIMARY KEY ( manager_id ),
	CONSTRAINT fk_manager_region FOREIGN KEY ( region_id ) REFERENCES "public".region( region_id )   ,
	CONSTRAINT fk_manager_sex FOREIGN KEY ( sex_id ) REFERENCES "public".sex( sex_id )   
 );

CREATE  TABLE "public".product ( 
	prod_id              serial  NOT NULL  ,
	product_id           varchar  NOT NULL  ,
	product_name         varchar  NOT NULL  ,
	sub_category_id      integer  NOT NULL  ,
	CONSTRAINT pk_product PRIMARY KEY ( prod_id ),
	CONSTRAINT fk_product_sub_category FOREIGN KEY ( sub_category_id ) REFERENCES "public".sub_category( sub_category_id )   
 );

CREATE  TABLE "public".sales ( 
	sales_id             serial  NOT NULL  ,
	order_id             varchar  NOT NULL  ,
	order_date           date  NOT NULL  ,
	ship_date            date  NOT NULL  ,
	ship_id              integer  NOT NULL  ,
	prod_id              integer  NOT NULL  ,
	customer_id          varchar  NOT NULL  ,
	city_id              integer  NOT NULL  ,
	sales                decimal  NOT NULL  ,
	quantity             integer  NOT NULL  ,
	discount             decimal    ,
	profit               decimal  NOT NULL  ,
	manager_id           integer  NOT NULL  ,
	returnes             varchar    ,
	segment_id           integer  NOT NULL  ,
	CONSTRAINT pk_sales PRIMARY KEY ( sales_id ),
	CONSTRAINT fk_sales_city FOREIGN KEY ( city_id ) REFERENCES "public".city( city_id )   ,
	CONSTRAINT fk_sales_shipping FOREIGN KEY ( ship_id ) REFERENCES "public".shipping( ship_id )   ,
	CONSTRAINT fk_sales_manager FOREIGN KEY ( manager_id ) REFERENCES "public".manager( manager_id )   ,
	CONSTRAINT fk_sales_product FOREIGN KEY ( prod_id ) REFERENCES "public".product( prod_id )   ,
	CONSTRAINT fk_sales_customer FOREIGN KEY ( customer_id ) REFERENCES "public".customer( customer_id )   ,
	CONSTRAINT fk_sales_segment FOREIGN KEY ( segment_id ) REFERENCES "public".segment( segment_id )   
 );

